import {
  ReactElement,
  JSXElementConstructor,
  ReactFragment,
  ReactPortal,
} from 'react';

type MovieProps = {
  Category: string;
  title: string;
  year: number;
  director: string;
  rating: string;
  edited: string;
};

export default function MovieCard(props: MovieProps) {
  return (
    <div className="max-w-sm rounded overflow-hidden shadow-lg bg-white">
      <div className="px-6 py-4">
        <div className="font-bold text-xl mb-2">{props.title}</div>
        <div className="grid grid-cols-2 gap-4 mx-auto">
          <div>Category</div>
          <div>
            {props.category}, {props.rating}
          </div>
        </div>
        <div className="grid grid-cols-2 gap-4 mx-auto">
          <div>Other Information</div>
          <div>Release Year: {props.year}</div>
          <div>Director: {props.director}</div>
          <div>Edited: {props.edited}</div>
        </div>
      </div>
    </div>
  );
}
